INSERT INTO `article` (`ID`, `Title`, `Content`, `Author`, `Posttime`, `Hits`, `Category`, `Top`) VALUES
(2730402900, '小托马斯十佳球：小IT成毒瘤？与兰德尔发生冲突 险约架！', '                    <p>　　NBA98.3月16日讯，在昨日NBA湖人与勇士的比赛中，小托马斯与兰德尔在第三节发生激烈的冲突，要不是球哥与洛佩兹在当中劝架，两人就已经动手了。并且昨日湖人面对的杜兰特率领的残阵勇士，最终湖人输掉了比赛，下面来看详细消息。</p>\n                    <p><img src=\"/public/images/img_9.png\" alt=\"\"></p>\n                    <p>然非常着急，在湖人的一次暂停中，他就对兰德尔表达了不满。</p>\n                    <p>最近很多球员都表示现在的联盟的防守强度很低，盖伊就表示现在的打法越来越软，罗斯则表示在防守端甚至都不能去碰对手，当然现在的联盟和10年前还是有一定的差距的，罗斯表示:如果乔丹在这个时代打球，然后又不能碰他，那乔丹场均可以拿多少分，当然这一直都是很多球迷议论的话，然后奥尼尔和麦迪都相继表示自己可以在这个时代轻松场均砍下40+，虽然他们作为球员时期个人能力很强，但真的就像他们所说的那样吗</p>\n                    <p>想想现在联盟最强的两个球员，也是NBA历史最佳之一的詹姆斯和杜兰特，他们在现在这个时代的联盟里打球场均才拿到27分，即使是最巅峰时期也是场均30+的得分而已，难道詹姆斯和杜兰特还不如麦迪吗，麦迪曾经说过自己在这个时代场均40分没有问题，而且詹姆斯和杜兰特都是处于生涯巅峰时期，依然是场均27+的得分而已，杜兰特在勇士不说，但詹姆斯在最近的两个赛季都是单核带队模式，也没有超过场均30+的得分，所以我们并不能说现在的联盟防守很差</p>\n                    <p><img src=\"/public/images/img_9.jpg\" alt=\"\"></p>\n                    <p>想想现在联盟最强的两个球员，也是NBA历史最佳之一的詹姆斯和杜兰特，他们在现在这个时代的联盟里打球场均才拿到27分，即使是最巅峰时期也是场均30+的得分而已，难道詹姆斯和杜兰特还不如麦迪吗，麦迪曾经说过自己在这个时代场均40分没有问题，而且詹姆斯和杜兰特都是处于生涯巅峰时期，依然是场均27+的得分而已，杜兰特在勇士不说，但詹姆斯在最近的两个赛季都是单核带队模式，也没有超过场均30+的得分，所以我们并不能说现在的联盟防守很差</p>', '篮球网', '2018-10-31 09:38:00', 1, 1, 00000000000),
