(2730402997, '小托马斯123', '<p>　　NBA98.3月16日讯，在昨日NBA湖人与勇士的比赛中，小托马斯与兰德尔在第三节发生激烈的冲突，要不是球哥与洛佩兹在当中劝架，两人就已经动手了。并且昨日湖人面对的杜兰特率领的残阵勇士，最终湖人输掉了比赛，下面来看详细消息。</p>', '篮球网', NULL, NULL, 1, 00000000000),
