(2730403012, 'SVCBA第18赛季报名结束', '<p>Onepiece杯SVCBA第18赛季已经结束，共有<span style=\"font-weight: bold;\">22</span>支男篮球队，以及<span style=\"font-weight: bold;\">5</span>支女篮球队参加新赛季的比赛。</p><p><br></p><p>新赛季赛制与上赛季一样: 全年共进行14场比赛，包括<span style=\"font-weight: bold;\">9</span>场常规赛和<span style=\"font-weight: bold;\">5</span>场季后赛。</p><p><br></p><p>男篮常规赛采用瑞士制，常规赛前8进入季后赛A组淘汰赛，常规赛9-16进入季后赛B组淘汰赛，常规赛17-22进入季后赛C组单循环赛。</p><p><br></p><p>男篮A组B组淘汰赛中，四分之一决赛和半决赛均采取两轮定胜负，决赛单场定胜负。</p><p><br></p><p>女篮常规带采用双循环，每轮有1支球队轮空，共比赛10轮常规赛。季后赛前两轮为排位赛，淘汰1支球队，季后赛后两轮为半决赛和决赛，均为单场定胜负。</p><p><br></p><p>18赛季上半赛季比赛日期如下</p><p><span style=\"font-weight: bold; color: rgb(194, 79, 74);\">8/25, 9/8, 10/6, 10/20, 11/3, 11/17, 12/1</span></p><p><br></p><p>2019/08/23</p><p><br></p><p><img src=\"http://svcsa.org/uploads/20190901/c415794a4062aafd8ec5413e606669f3.jpg\" style=\"max-width:100%;\"></p>', 'SVCBA组委会', '2019-08-31 03:01:05', NULL, 0, 00000000000),
(2730403013, 'Onepiece杯SVCBA18第一轮有奖竞猜结果', '<p>小四以11分获得当轮最佳，并获赠棒包一盒。</p><p><br></p><p><img src=\"http://svcsa.org/uploads/20190828/19028a3de8d3663789e333b59d09da51.png\" style=\"max-width:100%;\"></p>', 'SVCBA组委会', '2019-08-31 03:01:28', NULL, 0, 00000000000),
(2730403015, 'Onepiece杯SVCBA18第二轮有奖竞猜结果', '<p>mc咕佬肉以10分获得当轮最佳，并获赠棒包一盒！大白梨以8分进步6分的成绩获得最大进步奖。总积分榜上，小蚊子，SunnyChen，RC同以18分并列第一。</p><p><br></p><p><img src=\"http://svcsa.org/uploads/20190909/1a15c234f0f1d73f3997c5a8a8facc11.png\" style=\"max-width: 100%;\"></p><style type=\"text/css\"></style>', 'SVCBA组委会', '2019-09-08 11:06:05', NULL, 0, 00000000000),
(2730403016, 'Onepiece杯SVCBA18第三轮有奖竞猜结果', '<p>Mamba以10分获得当轮最佳，并获赠棒包一盒！zzz以10分进步4分的成绩获得最大进步奖。总积分榜上，SunnyChen，小四同以26分并列第一。\n\n</p><p><br></p><p><br></p>', 'SVCBA组委会', '2019-10-18 10:55:21', NULL, 0, 00000000000),
(2730403017, 'SVCBA重新开赛啦！', '<p><img src=\"http://svcsa.org/uploads/20220407/8f1b0b6c1d83e8d76265c46209ce3fa1.JPG\" style=\"max-width:100%;\"></p><p><br></p><p>被疫情耽搁了2年半之久的SVCBA终于要恢复比赛啦！</p><p><br></p><p>新赛季为短赛季，从2022年4月开始，到2022年6月结束，6个比赛日分别为：</p><p>4/10, 4/24, 5/8, 5/22, 6/5, 6/19</p><p>比赛时间为早上9点-下午3点</p><p><br></p><p>新赛季我们将比赛场馆从Foothill College迁移到了Ohlone College，具体地址为：</p><p>43600 Mission Blvd Building 9, Fremont, CA 94539</p><p>停车场：Ohlone College Parking Structure</p><p><br></p><p>新赛季所有入场观众均需出示ID及两针疫苗证明(电子版也可)</p><p><br></p><p>参赛球队及赛程结果请查询本官网。</p>', 'SVCBA组委会', '2022-04-06 08:56:43', NULL, 0, 00000000000),
(2730403018, 'SVCBA2022-2023赛季正式开始报名', '<p>报名费: $1500+$300押金</p><p>缴费方式: Venmo: svcba</p><p>报名网站: http://svcsa.org</p><p><br></p><p>比赛地点</p><p>Ohlone College</p><p><br></p><p>前六轮比赛日期</p><p>9/18, 10/2, 10/16, 10/30, 11/13, 12/4</p><p><br></p><p>报名组别：</p><p>男篮公开组</p><p>女篮公开组</p><p>男篮装年组</p><p><br></p>', 'SVCBA组委会', '2022-08-17 05:15:15', NULL, 0, 00000000000);
