(40, '江湖', 'PSW', '马少桢', 'mashaozhen@gmail.com', '8603367041', 'shaozhenma', '20190815/c5b13e1eb6e4443446bc223b80d7f312.png', '20190815/71c072da3b20a4a0cb0bd7b6a7dd3265.JPG', NULL),
(43, '老司机', '老司机 ', '王圣淳', 'slimjuzi@hotmail.com', '518-334-2513', 'ShaneBiomed', '20190820/f2242384efe4d6fe1a8c713c79238f4f.jpg', '20190820/3e276643977b4e16dc905955659a2dd9.jpg', '老司机队成立于2014年，由一群喜欢打球，喜欢在一起玩的朋友们组成。老司机的口号是“不忘初衷”，球队希望能让每个球员都能享受篮球。老司机常年由湾区金牌房产贷款经纪Irene Xie(ireneteam168@gmail.com)赞助，“买房贷款就要找Irene！”'),
(46, 'HeCares-THU', 'THU', 'Jing Liu', 'lakex24@gmail.com', '8314197687', '390728285', '20190818/c35989e640e0d698419226035ff4bacf.png', '', NULL),
(50, 'We Are Championship', 'WACH', 'Jack Sze Yeung Ng', 'jik.jack@gmail.com', '6502835564', 'szeyeungng', NULL, NULL, NULL),
(51, '恒星队', '恒星', '罗锦恒', '407351192@qq.com', '4152726878', 'Jason4153518567', '20190820/832f73e1eb83891bdb5b22c964cab74d.jpeg', '', '-'),
(52, 'Leslie地产-SuperMe', 'SuperMe', 'Bob Zheng', 'hzheng718@gmail.com', '6266733366', 'bobzheng718', '20190820/0abc26998a89527f5642b2aae5644a55.jpeg', '20190820/231638e610041e72741a1a9944fb523d.jpeg', 'SuperMe 是一支拼凑出来的新球队，大家通过篮球相识，慢慢成为湾区不可多得的挚友。 队里多位球员征战过美东杯，CEB Tournament。2019-2020 赛季他们希望能借SVCBA的舞台以球会友，拼尽每一滴汗。'),
(53, 'Spice Moms and Girls', 'SMG', 'Jinghua Yao', 'jinghua_yao@hotmail.com', '5106764801', 'jinghua_00', '20190820/ae94e89779ec57b8f9554c3201824f29.PNG', '20190821/f9ea7a9f442cec0b2a9d6c4d78d7b338.jpg', '我们有最好的队友，最棒的教练，最好玩的team building，从2017年到现在，我们的队伍一直在壮大。我们笑过，哭过，上过电视，拿过冠军。最重要的是，我们都热爱篮球，在打篮球中享受着热血，拼搏，信任，支持带来的快乐。我们打的不只是篮球，在这里，我们共享篮球的快乐，活出更精彩的人生。'),
