(103, '老司机', '老司机', '王圣淳', 'slimjuzi@hotmail.com', '5183342513', 'ShaneBiomed', '20220407/54c6bc7144d5266cd75686ed76706dae.jpg', '20220407/e4b823bfa243e2f75b76a395ab9ecd5e.jpg', '老司机队成立于2014年，由一群喜欢打球，喜欢在一起玩的朋友们组成。老司机的口号是“不忘初衷”，球队希望能让每个球员都能享受篮球。老司机常年由湾区金牌房产贷款经纪Irene Xie(ireneteam168@gmail.com)赞助，“买房贷款就要找Irene！”'),
