(112, 'Chinese Church In Christ', 'CCIC', 'Tim Wu', 'timmywu24@gmail.com', '7349452497', 'poxiaoming', '20220407/bb45f13f7e1cca0ee1bcbae9fad703af.jpeg', '20220407/d090e738e139f27e0c1d03451d1b18d2.jpeg', '我们是来自硅谷有着50年历史的华人教会CCIC，因为信仰，我们相聚在一起。也因为对篮球的热爱，我们决定一起加入这个SVCBA的大家庭。对我们而言，比赛胜负并不重要，重要的是通过比赛让我们彼此更加了解和团结，这才是比赛的真谛。无弟兄，不篮球！'),
