(118, 'BBLove', 'BBL', '林笑然', 'linxiaoran0210@gmail.com', '6692529918', 'linxiaoran1986', '20220323/045445354ca99fe6f83b4221a58119fa.jpeg', NULL, '从18年在Google Building 2015球场相识开始，我们经历了斯坦福的磨合期和野球场的融合期，球技投缘的大家最终走到了一起，于是我们决定在SVCBA的比赛中留下自己青春的回忆。激情、对抗、欢乐、团结、进取始终是这只球队的基因，BBLove显示着我们对篮球的热爱。最后，用一句话总结过去，展望将来：“谷歌相识战坦福，硅谷联赛引关注。”'),
(119, 'SuperMe', 'Sup', 'Bob Zheng', 'bobzheng718@gmail.com', '6266733366', 'bobzheng718', '20220324/5e99cd3723cfcede2f41e7157ca265f9.jpeg', '20220324/05eb614dd7e88293a8e54e108a6b1994.JPG', 'SuperMe 是一支拼凑出来的新球队，大家通过篮球相识，慢慢成为湾区不可多得的挚友。 队里多位球员征战过美东杯，CEB Tournament。2022 赛季他们希望能借SVCBA的舞台以球会友，拼尽每一滴汗。'),
(120, 'Mansion Bros', 'TMB', 'Yeqi Zhang', 'py20042008@gmail.com', '4156838157', 'qi266978', '20220324/e17bfcb465b2eca4a3bf272b8d144d6b.jpeg', NULL, 'Mansion Bros是一支由一群篮球爱好者组成的队伍，结缘于Mansion Grove的室外篮球场。这次比赛我们争取赛出水平，打出风采。'),
(122, 'NEWS67人', '67ers', 'Daiyi Lyu', 'rudylyu@gmail.com', '4127084860', 'D-Yat13', '20220325/c76a8ed2e0c667919ece6b3574d86084.pdf', '', '我们是一支今年刚组建的全新的队伍。队员都是平时一起打球的同学和朋友。大家普遍都是来湾区没几年，今年第一次报名参加比赛，希望可以取得一个不错的成绩。队名中的NEWS代表我们队中每个人的家乡正好能凑齐东南西北四个字，67人代表每次比赛估只能来6、7个人。每场比赛能凑够五个首发就已经算赢了一半了。'),
(123, 'HeCares-西南联队', '西南联队', 'Jing Liu', 'lakex24@gmail.com', '8314197687', '39028285', '20220325/6e016bba0dcec0f010f15fe839d9fbc3.png', NULL, '西南联队，是中国抗美战争开始后球队外迁设于硅谷的一支综合性球队。'),
