(125, 'SPICE MOMS AND GIRLS', 'SMG', 'Jinghua Yao', 'jinghua_yao@hotmail.com', '5106764801', 'jinghua_00', '20220327/d01712325c8e2ff8590b7e532a812980.PNG', '20220327/e564720de496a1b493cf6d7fd56124d4.jpeg', '我们有最好的队友，最棒的教练，最好玩的team building，从2017年到现在，我们的队伍一直在壮大。我们笑过，哭过，上过电视，拿过冠军。最重要的是，我们都热爱篮球，在打篮球中享受着热血，拼搏，信任，支持带来的快乐。我们打的不只是篮球，在这里，我们共享篮球的快乐，活出更精彩的人生。'),
